import React from "react";
import { useNavigate } from "react-router-dom";
import "./landingPage.css";

const LandingPage = () => {
  const navigate = useNavigate();

  const navigateTo = (path) => {
    navigate(path);
  };

  return (
    <div className="full-page">
      {/* Header */}
      <header className="header">
        <div className="container">
          <a href="#" className="logo">
            <span>EventHive</span>
          </a>
          <nav className="nav">
            <a href="#">Find Partners</a>
            <a href="#">Hackathons</a>
            <a href="#">About</a>
          </nav>
        </div>
      </header>

      {/* Hero Section */}
      <main className="hero">
        <div className="container">
          <h1>Find Your Perfect Hackathon Team</h1>
          <p>
            Connect with skilled developers, designers, and innovators. Build
            amazing projects together.
          </p>
          <div className="cta-buttons">
            <button onClick={() => navigateTo("/registration")} className="btn">
              Sign Up
            </button>
            <button onClick={() => navigateTo("/login")} className="btn">
              Login
            </button>
          </div>
        </div>
      </main>

      {/* Footer */}
      <footer className="footer">
        <div className="container">
          <p>Â© 2024 HackPartner. All rights reserved.</p>
          <nav>
            <a href="#">Terms of Service</a>
            <a href="#">Privacy</a>
          </nav>
        </div>
      </footer>
    </div>
  );
};

export default LandingPage;
